import React from "react";
import { createBrowserRouter } from "react-router-dom";
  
import GlobalFeed from 'pages/global-feed';
import Article from 'pages/article';
  
const routes = createBrowserRouter([
    {
        path: "/",
        element: <GlobalFeed/>,
    },
    {
        path: "/articles/:slug",
        element: <Article/>,
    },
]);

export default routes;